    data: |
      SELECT col0 + ( 58 + col0 ) FROM tab2 (FORMAT parquet) WHERE NOT 19 BETWEEN ( ( col1 ) + - col1 / col0 ) AND + col2 + - col0;
  - name: tab2

outputs:
